import express from 'express';
import routes from '../api/routes';
import handleError from '../middlewares/handleError';

const app = express();

app.use(express.json());

app.use('/login', routes.login);

app.use(handleError);
export default app;

import login from './login.routes';

export default {
  login
};

import { Router } from 'express';
import controller from '../controllers';
import 'express-async-errors';

const router = Router();

router.post('/', controller.login.execute);

export default router;

import login from './login.controller';

export default {
  login
};

import { Request, Response } from 'express';
import ILogin from '../../interfaces/ILogin';
import service from '../services';

export default {
  async execute(req: Request, res: Response) {
    const { username, password } = req.body as ILogin;
    const token = await service.login.execute({ username, password });
    return res.status(200).json({ token });
  }
};

import login from './login.service';

export default {
  login 
};

import repository from '../../database/Repository';
import ILogin from '../../interfaces/ILogin';
import AppError from '../../utils/appError';
import generateToken from '../../utils/generateToken';

export default {
  async execute(data: ILogin) {
    const findAdmin = await repository.admin.execute(data);

    if (!findAdmin) throw new AppError('Admin not found', 404);

    const { password, username, id } = findAdmin;
    if (password !== data.password) throw new AppError('Invalid fields', 400);

    return generateToken({ username, id});
  }
};

import admin from './admin.repository';

export default {
  admin
};

import { Admin } from '@prisma/client';
import ILogin from '../../interfaces/ILogin';
import { prisma } from '../cliente';

export default {
  async execute({ username }: ILogin): Promise<Admin | null> {
    return prisma.admin.findUnique({ where: { username }});
  }
};

import IAppError from '../interfaces/IAppError';

export default class AppError implements IAppError {
  constructor(public message: string, public statusCode = 400){}
}

import { Admin } from '@prisma/client';
import jwt from 'jsonwebtoken';
import 'dotenv';

export default (payload: Pick<Admin, 'id' | 'username'>) => {
  const jwtKey = process.env.JWT_SECRET as jwt.Secret;

  const token = jwt.sign(payload, jwtKey);
  return token;
};

import { NextFunction, Request, Response } from 'express';
import IAppError from '../interfaces/IAppError';
import AppError from '../utils/appError';

export default (error: Error | IAppError, _req: Request, res: Response, _next: NextFunction) => {
  if (error instanceof AppError) {
    return res.status(error.statusCode).json({ message: error.message });
  }
  console.log(error.message);
  return res.status(500).json({ message: 'Internal server error '});
};
